import React from "react";

import { useForm } from "react-hook-form";

function Scoring() {
  const pathname = window.location.pathname;
  let id = pathname.split("/");
  id = id[2];
  const {
    register,
    handleSubmit,
    formState: { errors },
    reset,
  } = useForm({
    mode: "onBlur",
  });
  const onSubmit = (data) => {
    fetch(`http://localhost:8080/application/registration/${id}`, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(data),
    })
      .then((response) => response.json())
      .then((res) => console.log(res));

    reset();
  };
  return (
    <>
      <div className="scoring">
        <div className="header-scoring">
          <h1>Continuation of the application</h1>
          <p>Step 2 of 5</p>
        </div>
        <div className="body-scoring">
          <form onSubmit={handleSubmit(onSubmit)}>
            <div className="item1-scoring">
              <label>
                What's your gender <span>*</span>
                <br />
                <select {...register("gender", { required: false })}>
                  <option value="6">6 month</option>
                  <option value="12">12 month</option>
                  <option value="18">18 month</option>
                  <option value="24">24 month</option>
                </select>
              </label>
            </div>
            <div className="item2-scoring"></div>
            <div className="item3-scoring"></div>
            <div className="item4-scoring"></div>
            <div className="item5-scoring"></div>
          </form>
        </div>
      </div>
    </>
  );
}

export default Scoring;
